  /*********************************************
   * GLOBAL STYLES
   *********************************************/

  body, .reveal, .reveal-preview {
  	background-color: rgb(105,19,12);
  }

  .reveal, .reveal-preview  {

    color: #fff;
  }

  ::selection {
  	background: rgb(255, 255, 255);
  }

  /*********************************************
   * HEADERS
   *********************************************/

  .reveal h1, .reveal-preview h1,
  .reveal h2, .reveal-preview h2,
  .reveal h3, .reveal-preview h3,
  .reveal h4, .reveal-preview h4,
  .reveal h5, .reveal-preview h5,
  .reveal h6, .reveal-preview h6 {

  	color: #fff;
  }


  /*********************************************
   * LINKS
   *********************************************/

  .reveal a, .reveal-preview a {
  	color: #ffef99;
    text-decoration: undefined;
  }
  	.reveal a:hover, .reveal-preview a:hover {
  		color: #ffe34d;
  	}


  /*********************************************
   * NAVIGATION CONTROLS
   *********************************************/

  .reveal .controls .navigate-left,
  .reveal .controls .navigate-left.enabled {
  	border-right-color: #ffef99;
  }

  .reveal .controls .navigate-right,
  .reveal .controls .navigate-right.enabled {
  	border-left-color: #ffef99;
  }

  .reveal .controls .navigate-up,
  .reveal .controls .navigate-up.enabled {
  	border-bottom-color: #ffef99;
  }

  .reveal .controls .navigate-down,
  .reveal .controls .navigate-down.enabled {
  	border-top-color: #ffef99;
  }

  .reveal .controls .navigate-left.enabled:hover {
  	border-right-color: #ffe34d;
  }

  .reveal .controls .navigate-right.enabled:hover {
  	border-left-color: #ffe34d;
  }

  .reveal .controls .navigate-up.enabled:hover {
  	border-bottom-color: #ffe34d;
  }

  .reveal .controls .navigate-down.enabled:hover {
  	border-top-color: #ffe34d;
  }

